Ramp progressions… Back in 2018 I knew I needed a bigger quarter pipe landing as the contests kept progressing and we kept going higher but it was difficult finding investors who saw the importance of having a bigger landing since it was such a new event. So I went to Home Depot, spent $15,000 in lumber/tools, and worked for 31 days with 1 helper grabbing me screws, material, & batteries while I built it. That landing I built at the OG Mulisha compound helped me train for what ended up being 2 gold medals. After, I bought my own property and the goal was to build an even bigger landing that would match up with the 30 foot quarter pipe take off ramp that I bought. I needed a landing wider and taller that would allow me to go higher. Once again, I invested another bag of $ on heavy equipment, 2 containers, grabbed a couple of my friends and went back to work. My years of framing came in clutch and allowed me to do this type of build (saving money) which also helped me progress my skills and heights in moto. I was able to grab another gold in QP this year and I’m currently more motivated than ever and ready to keep building bigger and better ramps #SkysTheLimit Also, I can’t wait for everyone to finally see the movie “Gnarnia” after a long wait, the movie will finally be available for the public to view October 17th 2023!!! It will be available to download on different platforms. 
Thanks to my sponsors for being apart of this journey 🦅 @rockstarenergy @livefreeridefree.co @ftwshredco @drinkdeville @husqvarnamotorcyclesusa @onealracing @hyrmotorsports @claybournecompany @crown_cdjr @pit_viper @ripzmoto @odigrips @marjonrvs @gobigtruckperformance
